create database if not exists `coffee`;

USE `coffee`;

/*Table structure for table `behave` */

DROP TABLE IF EXISTS `behave`;

CREATE TABLE `behave` (
  `no` int(10) NOT NULL,
  `name` varchar(10) DEFAULT NULL,
  PRIMARY KEY (`no`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `behave` */

insert  into `behave`(`no`,`name`) values (1,'读书'),(2,'运功'),(3,'旅行');

/*Table structure for table `department` */

DROP TABLE IF EXISTS `department`;

CREATE TABLE `department` (
  `dno` int(10) NOT NULL AUTO_INCREMENT,
  `dname` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`dno`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `department` */

/*Table structure for table `food` */

DROP TABLE IF EXISTS `food`;

CREATE TABLE `food` (
  `fid` int(10) NOT NULL AUTO_INCREMENT,
