/*Table structure for table `foodkind` */

DROP TABLE IF EXISTS `foodkind`;

CREATE TABLE `foodkind` (
  `fkid` varchar(20) NOT NULL,
  `fkname` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`fkid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `foodkind` */

insert  into `foodkind`(`fkid`,`fkname`) values ('01','拿铁'),('02','意式浓缩'),('03','蓝山'),('04','卡布奇诺');

/*Table structure for table `member` */

DROP TABLE IF EXISTS `member`;

CREATE TABLE `member` (
  `mid` int(10) NOT NULL AUTO_INCREMENT,
  `mname` varchar(10) DEFAULT NULL,
  `mpassword` varchar(20) DEFAULT NULL,
  `memail` varchar(20) DEFAULT NULL,
  `msex` varchar(4) DEFAULT NULL,
  `fkid` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`mid`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8;

